import './App.css';
import { Journal } from './components/Journal';
import { Navbar } from './components/Navbar';
import image from './components/images/Path.png';
import map from './components/images/'



function App() {
  return (
    <div className="App">
     <img src={image} className="banner-image" alt="" />
    <Navbar img={image}/>
    <Journal img={map}/>
    </div>
  );
}

export default App;
